import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import Navbar from '../components/Navbar';
import TicketCard from '../components/TicketCard';
import StatCard from '../components/StatCard';
import ChartComponent from '../components/ChartComponent';
import ticketService from '../services/ticketService';
import userService from '../services/userService';
import '../styles/Dashboard.css';

const AdminDashboard = () => {
  const [dashboardData, setDashboardData] = useState({});
  const [recentTickets, setRecentTickets] = useState([]);
  const [systemHealth, setSystemHealth] = useState({});
  const [loading, setLoading] = useState(true);
  const [timeRange, setTimeRange] = useState('7d'); // 7d, 30d, 90d

  useEffect(() => {
    fetchDashboardData();
    // Real-time updates every 30 seconds
    const interval = setInterval(fetchDashboardData, 30000);
    return () => clearInterval(interval);
  }, [timeRange]);

  const fetchDashboardData = async () => {
    try {
      const [stats, tickets, health, trends] = await Promise.all([
        userService.getDashboardStats({ range: timeRange }),
        ticketService.getTickets({ limit: 8, sortBy: 'createdAt', sortOrder: 'desc' }),
        userService.getSystemHealth(),
        ticketService.getTicketTrends({ range: timeRange })
      ]);

      setDashboardData({ ...stats, trends });
      setRecentTickets(tickets.tickets);
      setSystemHealth(health);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    } finally {
      setLoading(false);
    }
  };

  const quickActions = [
    { label: 'Manage Users', icon: 'üë•', path: '/admin/users', color: 'primary' },
    { label: 'System Settings', icon: '‚öôÔ∏è', path: '/admin/settings', color: 'secondary' },
    { label: 'Generate Report', icon: 'üìä', path: '/admin/reports', color: 'success' },
    { label: 'View Analytics', icon: 'üìà', path: '/admin/analytics', color: 'info' }
  ];

  if (loading) {
    return (
      <>
        <Navbar />
        <div className="loading-container">
          <div className="loading-spinner"></div>
          <p>Loading dashboard data...</p>
        </div>
      </>
    );
  }

  return (
    <>
      <Navbar />
      <div className="dashboard admin-dashboard">
        {/* Header with Time Range Filter */}
        <div className="dashboard-header">
          <div className="header-main">
            <h1>Admin Dashboard</h1>
            <p>Comprehensive overview of system performance and metrics</p>
          </div>
          <div className="header-controls">
            <select 
              value={timeRange} 
              onChange={(e) => setTimeRange(e.target.value)}
              className="time-range-selector"
            >
              <option value="24h">Last 24 Hours</option>
              <option value="7d">Last 7 Days</option>
              <option value="30d">Last 30 Days</option>
              <option value="90d">Last 90 Days</option>
            </select>
          </div>
        </div>

        {/* System Health Alert */}
        {systemHealth.status !== 'healthy' && (
          <div className={`health-alert ${systemHealth.status}`}>
            <span className="alert-icon">‚ö†Ô∏è</span>
            <div className="alert-content">
              <strong>System Alert:</strong> {systemHealth.message}
            </div>
            <button className="alert-action">View Details</button>
          </div>
        )}

        {/* Quick Actions */}
        <div className="quick-actions-section">
          <h2>Quick Actions</h2>
          <div className="quick-actions-grid">
            {quickActions.map((action, index) => (
              <Link 
                key={index}
                to={action.path} 
                className={`quick-action-card ${action.color}`}
              >
                <div className="action-icon">{action.icon}</div>
                <span className="action-label">{action.label}</span>
              </Link>
            ))}
          </div>
        </div>

        {/* Key Metrics Grid */}
        <div className="metrics-section">
          <h2>Key Performance Indicators</h2>
          <div className="metrics-grid">
            <StatCard
              title="Total Tickets"
              value={dashboardData.totalTickets}
              change={dashboardData.ticketGrowth}
              changeType={dashboardData.ticketGrowth > 0 ? 'increase' : 'decrease'}
              icon="üìã"
              color="primary"
            />
            <StatCard
              title="Open Tickets"
              value={dashboardData.openTickets}
              change={dashboardData.openTicketTrend}
              changeType={dashboardData.openTicketTrend > 0 ? 'increase' : 'decrease'}
              icon="üü°"
              color="warning"
            />
            <StatCard
              title="Avg. Resolution Time"
              value={`${dashboardData.avgResolutionTime}m`}
              change={dashboardData.resolutionTimeTrend}
              changeType={dashboardData.resolutionTimeTrend > 0 ? 'increase' : 'decrease'}
              icon="‚è±Ô∏è"
              color="info"
            />
            <StatCard
              title="SLA Compliance"
              value={`${dashboardData.slaCompliance}%`}
              change={dashboardData.slaTrend}
              changeType={dashboardData.slaTrend > 0 ? 'increase' : 'decrease'}
              icon="‚úÖ"
              color="success"
            />
            <StatCard
              title="User Satisfaction"
              value={`${dashboardData.satisfactionRate}%`}
              change={dashboardData.satisfactionTrend}
              changeType={dashboardData.satisfactionTrend > 0 ? 'increase' : 'decrease'}
              icon="‚≠ê"
              color="success"
            />
            <StatCard
              title="First Contact Resolution"
              value={`${dashboardData.firstContactResolution}%`}
              change={dashboardData.fcrTrend}
              changeType={dashboardData.fcrTrend > 0 ? 'increase' : 'decrease'}
              icon="üéØ"
              color="info"
            />
          </div>
        </div>

        {/* Charts and Analytics */}
        <div className="analytics-section">
          <div className="analytics-grid">
            {/* Ticket Trends Chart */}
            <div className="analytics-card">
              <div className="card-header">
                <h3>Ticket Volume Trends</h3>
                <span className="card-subtitle">Last {timeRange}</span>
              </div>
              <div className="card-content">
                <ChartComponent
                  type="line"
                  data={dashboardData.trends?.volume || []}
                  height={250}
                />
              </div>
            </div>

            {/* Ticket Distribution */}
            <div className="analytics-card">
              <div className="card-header">
                <h3>Ticket Distribution</h3>
                <span className="card-subtitle">By Category</span>
              </div>
              <div className="card-content">
                <ChartComponent
                  type="doughnut"
                  data={dashboardData.ticketsByType || []}
                  height={250}
                />
              </div>
            </div>

            {/* Technician Performance */}
            <div className="analytics-card">
              <div className="card-header">
                <h3>Technician Performance</h3>
                <span className="card-subtitle">Resolution Efficiency</span>
              </div>
              <div className="card-content">
                <ChartComponent
                  type="bar"
                  data={dashboardData.technicianPerformance || []}
                  height={250}
                />
              </div>
            </div>

            {/* Urgency Distribution */}
            <div className="analytics-card">
              <div className="card-header">
                <h3>Urgency Levels</h3>
                <span className="card-subtitle">Ticket Priority Distribution</span>
              </div>
              <div className="card-content">
                <ChartComponent
                  type="pie"
                  data={dashboardData.ticketsByUrgency || []}
                  height={250}
                />
              </div>
            </div>
          </div>
        </div>

        {/* Recent Activity Section */}
        <div className="recent-activity-section">
          <div className="section-header">
            <h2>Recent Tickets</h2>
            <Link to="/tickets" className="btn-primary">
              View All Tickets
            </Link>
          </div>
          
          {recentTickets.length === 0 ? (
            <div className="empty-state">
              <div className="empty-icon">üìã</div>
              <h3>No Recent Tickets</h3>
              <p>There are no tickets in the system yet.</p>
            </div>
          ) : (
            <div className="tickets-grid compact">
              {recentTickets.map(ticket => (
                <TicketCard key={ticket._id} ticket={ticket} compact={true} />
              ))}
            </div>
          )}
        </div>

        {/* System Overview */}
        <div className="system-overview">
          <h2>System Overview</h2>
          <div className="system-grid">
            <div className="system-card">
              <h4>Users</h4>
              <div className="system-stats">
                <span className="stat">Total: {dashboardData.totalUsers}</span>
                <span className="stat">Active: {dashboardData.activeUsers}</span>
                <span className="stat">New: {dashboardData.newUsers}</span>
              </div>
            </div>
            <div className="system-card">
              <h4>Technicians</h4>
              <div className="system-stats">
                <span className="stat">Total: {dashboardData.totalTechnicians}</span>
                <span className="stat">Available: {dashboardData.availableTechnicians}</span>
                <span className="stat">Busy: {dashboardData.busyTechnicians}</span>
              </div>
            </div>
            <div className="system-card">
              <h4>Knowledge Base</h4>
              <div className="system-stats">
                <span className="stat">Articles: {dashboardData.totalArticles}</span>
                <span className="stat">Views: {dashboardData.articleViews}</span>
                <span className="stat">Helpful: {dashboardData.helpfulArticles}%</span>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default AdminDashboard;
